import { INCREMENT,DECREMENT} from './tipe'

export const setIncrement = (counter) => (
    {
        type: INCREMENT,
        data:counter
    }
);

export const setDecrement = (counter) => (
    {
        type: DECREMENT,
        data: counter
    }
);
